import styled from "styled-components";

export const ErroContainer = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  flex-direction: column;
  background-color: #e86e5a;

  img {
    width: 100vw;
    max-width: 400;
    height: 100vh;
    max-height: 830;
  }
`;
